import React from 'react'
import {Avatar, Card} from 'antd';

const UserProfile = () => {
  return (
    <Card>
        <Card.Meta
            avatar={<Avatar>EK</Avatar>}
            title="Eunkk"
        />
    </Card>
  )
}

export default UserProfile;
